import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/bonfire.gif';
const Header = () => {


return (
    <header>
        <img src={logo} alt="Bonfire Logo" height="200" />
        <Link to="/"></Link>
    </header>
    );
};
export default Header;
